# Enable arcs support
[gcode_arcs]
resolution: 0.1

[exclude_object]

[include timelapse.cfg]

[include custom/printers/doomcube/doomcube.cfg]

[include custom/toolheads/calamity.cfg]

[include AFC/*.cfg]

[include custom/tuning/*]

[include custom/sensors/chamber_thermistor.cfg]

[include custom/fans/*]

[include custom/leds/*]

[include custom/macros.cfg]


[resonance_tester]
#accel_chip_x: beacon
#accel_chip_y: beacon
accel_chip_x: adxl345 toolboard_t0
accel_chip_y: adxl345 toolboard_t0
probe_points:
	150,150,20
accel_per_hz: 100
sweeping_accel: 400
sweeping_period: 0

[input_shaper]
shaper_type_x = mzv
shaper_freq_x = 67
shaper_type_y = ei
shaper_freq_y = 64
damping_ratio_x: 0.085 # damping ratio for the X axis
damping_ratio_y: 0.062 # damping ratio for the Y axis

